import React, { useEffect, useState, useCallback } from 'react';
import { Form, Input, Button, Checkbox, Row, Col } from 'antd';
import Link from 'next/link';
import useInput from '../hooks/useInput';
import { UserOutlined, LockOutlined } from '@ant-design/icons';
import { GoogleLogin } from 'react-google-login';
import { css } from '@emotion/react';


const layout = {
    wrapperCol: {
        span: 16,
    },
};
const tailLayout = {
    wrapperCol: {
        span: 16,
    },

};


const LoginForm = (props) => {
    const { onLoginGoogle } = props;
    const responseGoogle = (response) => {
        console.log(response);
    }

    const onFinish = (values) => {
        console.log('Success:', values);
    };

    const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
    };


    return (
        <Form
            {...layout}
            name="basic"
            initialValues={{
                remember: true,
            }}
            onFinish={onFinish}
            onFinishFailed={onFinishFailed}
        >
            <Form.Item

                name="username"
                rules={[
                    {
                        required: true,
                        message: 'Please input your username!',
                    },
                ]}
            >
                <Input prefix={<UserOutlined className="site-form-item-icon" />} placeholder="Username" />
            </Form.Item>

            <Form.Item
                name="password"
                rules={[
                    {
                        required: true,
                        message: 'Please input your password!',
                    },
                ]}
            >
                <Input
                    prefix={<LockOutlined className="site-form-item-icon" />}
                    type="password"
                    placeholder="Password"
                />
            </Form.Item>

            <Form.Item {...layout} name="remember" valuePropName="checked">
                <Checkbox>Remember me</Checkbox>
            </Form.Item>

            <Form.Item {...tailLayout} justify="end"  >
                <Row gutter={8} >
                    <Col xs={12} md={6}>
                        <Button type="primary" htmlType="submit"
                        >
                            로그인
            </Button>
                    </Col>
                    <Col xs={12} md={6}>
                        <Link href="/signup"><a><Button>
                            회원가입
            </Button></a></Link>
                    </Col>
                </Row>
            </Form.Item>

            <Row gutter={8}>
                <Form.Item {...tailLayout} >
                    <GoogleLogin
                        clientId="545728216093-t5bheggfvpap4lc3a2gr5s8tneslia4v.apps.googleusercontent.com"
                        buttonText={"Google"}
                        render={(props) => (
                            <div onClick={props.onClick} />
                        )}
                        onSuccess={result => onLoginGoogle(result)}
                        onFailure={result => console.log(result)}
                        cookiePolicy={'single_host_origin'}
                    />
                </Form.Item>
            </Row>
        </Form>
    );


};
export default LoginForm;
